@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent {

}
<div class='container-fluid'>
  <div class='row'>
    <div class='col'>
      <h1>About us</h1>
      <hr>
      <p>Programador: Carlos M.</p>
      <p>Versión: v1.0</p>
